class MessageParser {
    constructor(actionProvider, state) {
        this.actionProvider = actionProvider;
        this.state = state;
    }

    parse(message) {
        // Log the latest message
        console.log("Latest Message:", message.text);

        // Log all previous messages (assuming each message has a 'text' property)
        const allPreviousMessages = this.state.messages.map(msg => msg.text);
        console.log("All Previous Messages:", allPreviousMessages);
    }
}

export default MessageParser;
